import React from "react";
import Navbar from "react-bootstrap/Navbar";

const Nav = () => {
  return (
    <div>
      <Navbar expand="lg" variant="dark" bg="dark">
        <Navbar.Brand href="#">Navbar</Navbar.Brand>
      </Navbar>
    </div>
  );
};

export default Nav;
